      <span className='Dailycontainer'>
        <span className='Dailyitems'>Complete SWE Project</span>
        <span className='Dailyitems'>Complete SWE Project</span>
        <span className='Dailyitems'>Complete SWE Project</span>
        <span className='Dailyitems'>Complete SWE Project</span>
      </span>
    )
  }
}
